import React, { useContext } from 'react'
import { GlobalContext } from '../Context/GlobalState';

export const TransHistory = () => {

  const { transactions, DelTransaction } = useContext(GlobalContext);

  // console.log(transactions);
  return (
    <div className='transHistory-box'>
        <h4>Your Transactions:</h4>
        <ul className='transactions'>
          {
            transactions.map((transaction)=>{
              return <li className='transaction' key={transaction.id}><span>{transaction.desc}</span> <span>${transaction.amount}</span>
              <button className='DelBtn' onc>X</button></li>
            })
          }
        </ul>
        <hr />
    </div>
  )
}
